import React, { useState } from 'react'
import styles from './List.module.css'

const List = (props) => {
    const [value,setValue] = useState('')

    return(
        <div className={styles.list}>
            <input type="text" value={value} onChange={(e) => setValue(e.currentTarget.value)}/>
        </div>
    )
}

export default List
